import Link from "next/link";

const navbar = () => (
  <div className="ui-navbar">
    <Link href="/">
      <a>home </a>
    </Link>
    <Link href="/login">
      <a>login </a>
    </Link>
    <Link href="/register">
      <a>register </a>
    </Link>
  </div>
);
export default navbar;
